import axios from 'axios';

export const checkEmailExists = (email) => axios.get('/server/src/routes/users/' + email);
export const checkUsernameExists = (username) => axios.get('/server/src/routes/users/' + username);

export const localRegister = ({email, username, password}) => axios.post('/server/src/routes/users', { email, username, password });
export const localLogin = ({email, password}) => axios.post('/server/src/routes/users', { email, password });

export const checkStatus = () => axios.get('/server/src/routes/session');
export const logout = () => axios.delete('/server/src/routes/session');
